import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { id: "e1", title: "toilet paper", amount: 94 },
    { id: "e2", title: "kitchen paper", amount: 23 },
    { id: "e3", title: "drawing paper", amount: 94 },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0]}></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
